INSERT INTO `wp_ajaxsearchpro_statistics` VALUES('3656', '1', ' 重垢液体去污剂 旨在节约成本 无磷，可生物降解且易于处理 替换了腐蚀性酸和危险溶剂 低泡重垢去污效果非常好 易于冲洗，结果可靠，而且没有有害残留物 用于清洗验证测试设备，以通过实验室认证和工厂检测审核 用于清洗以下器具: 卫生机构仪器、实验室器皿、真空设备、组织培养器皿、个人防护设备、取样装置、导液管、油管、管道、磁盘驱动器、无尘室、EEG病人准备设备、光学部件、电子组件、药品装置、化妆品制造设备、锻造金属、冲压和铸造件、工业部件、容器和反应器。经过USDA授权，可用在经过联邦政府检查的肉类和禽类工厂。通过了水质分析的禁用物残留测试通过了FDA认证。   用于去除以下物质：污垢、粗砂、尘垢、黏土、油脂、油、血渍、颗粒、沉淀、微粒、溶剂、化学品 。   清洗以下表面: 缓蚀型配方，建议清洗玻璃、金属、不锈钢、瓷器、陶瓷、塑料、橡胶和玻璃纤维。如果迅速清洗的话，可以用在铜、铝、锌和镁等软金属上。用于还原艺术品。建议进行腐蚀性测试。   清洗方法:浸泡、刷洗、用海绵吸、用布擦、超声波、就地清洗。会起泡 - 不适合喷洗或机洗。   说明: 用冷水、温水或热水配制新鲜的1%溶液(每加仑 2 1/2 汤匙，每加仑 1 1/4 盎司或者每升10克)。尽量使用热水。使用冷水会留下水渍。对于难以清洗的污垢，请提高水温并加大去污剂的用量。用浸泡、循环、擦拭或超声波方法清洗。配戴防护手套和眼镜。会起泡，不适合喷洗设备。最好用流水彻底冲洗。对于重垢，最好用蒸馏水、去离子水或纯净水冲洗，或者整个过程都用这些水进行冲洗。对于食物接触表面，用饮用水进行冲洗。可广泛用在玻璃、陶瓷、塑料和金属表面上。建议进行腐蚀性测试。     便于使用的尺寸: 12 × 1 夸脱包装箱 4 × 1 加仑包装箱 15 加仑包装箱 30 加仑包装箱 55 加仑包装箱 1 加仑可配成 100 加仓洗液  物理数据                                                                                  典型值 1%溶液的PH值                                                                         8.5 比重（g/ml)                                                                              1.07 密度（lbs./gal.）                                                                      8.9 蒸汽压力（mm Hg）                                                                10.5 闪点(华氏度)                                                                             无 磷酸盐的含量(以磷的形式)                                                        0 % 有机碳(%，按w/w计算 )                                                            21 % 香料含量                                                                                    0 % 五百分之一溶液的表面张力(Dyne/c m)                                    小于 颜色: 淡黄色 形态:  液态 在水中的济解度:  可按任意比例完全溶于水 在硬水中的有效性 ： 非常有效 生物降解性: 可生物降解 起泡倾向: 极易起泡 储藏期限：自生产之日起两年   化学描述   Liquinox 主要由线性烷芳基磺酸钠、二甲苯磺酸钠、链烷醇酰胺和乙氧基醇的均匀混合物组成。Liquinox 在本质上是阴离子清洗剂。   清洗验证方法:   在冲洗已清洗的表面之前和之后测试冲洗水的参数。参数无显著变化表明冲洗水中没有可检测到的残留物。测量的参数包括: PH值、电导率、UV、TOC、HPLC、钠的浓度、磷的浓度、阴离子表面活性剂的浓度(使用便宜的去污剂水测试仪器)、表面张力和表面分析。药物清洗验证参考可从www..alconox.com上的技术信息部分获得。   安全健康信息:   OSHA 有毒成分: 无 RCRA 危险类: 没有危险 EPA 最先污染物 ：无 DOT 危险类：无 可燃性: 不可燃 乳胶含量: 在去污剂、包装材料或粘合剂中无。 口服毒性: (5 g/kg > 500 mg/kg)不含被 OSHA定义为口服毒性的成分 对眼睛的剌激性:如果不冲洗的话，会对眼睛造成轻微或中度剌激 吸人毒性: 无剌激性 VOC 含量: 0% 致癌性： NTP =无   IARC =元  OSHA =无 Liquinox 中的所有成分都列在 TSCA 清单中。USDA  NSF目录Al   预防措施:   除了符合所有工业化学品的良好工业卫生和安全惯例(请参阅\\\"说明\\\")以外，无需任何特殊的预防措施。物质安全数据表可以根据需要拨打电话 0512-36839027 索取。', '2', '1493016521');
